from sympy import factorint
def ok(n):
  f = factorint(n, limit=4)
  i, j = 0 if 2 not in f else f[2], 0 if 3 not in f else f[3]
  return (i-j)%3 == 0
def aupto(limit): return [m for m in range(1, limit+1) if ok(m)]
